import random

generated_achievements = []
index_choices = list(range(len(achievements)))
random.shuffle(index_choices)

while len(generated_achievements) < 25:
    random_index = index_choices.pop()
    random_achievement = achievements[random_index]
    generated_achievements.append(random_achievement)

file_builder = open("game/track_achievements.mcfunction", "w+")
file_builder2 = open("game/load_markers.mcfunction", "w+")
file_builder3 = open("game/give_achievement_book.mcfunction", "w+")

file_builder2.write("kill @e[type=marker]\n\n")
file_builder3.write("clear @s written_book{title:\"Achievement Bingo\",author:\"Ajonzy\"}\nexecute if data entity @s Inventory[{Slot:8b}] at @s run summon item ~ ~ ~ {Item:{id:\"minecraft:stone\",Count:1b},Tags:[\"dropped\"]}\ndata modify entity @e[type=item,tag=dropped,limit=1] Item set from entity @s Inventory[{Slot:8b}]\ntag @e[type=item] remove dropped\n\n")
file_builder3.write("scoreboard objectives add Math dummy\n")
file_builder3.write("execute as @e[type=marker] run scoreboard players operation @s Math = @s BingoTracker\n\n")

for index, achievement in enumerate(generated_achievements):
    row = (index // 5) + 1
    col = (index % 5) + 1
    file_builder.write(f'execute as @a[advancements={{{achievement["id"]}=true}},scores={{Row{row}Col{col}=0}}] run scoreboard players add @s Row{row}Col{col} 1\n')

    file_builder2.write(f"summon marker 0 0 0 {{NoGravity:1b,Invulnerable:1b,CustomNameVisible:0b,Tags:['{{\"text\":\"X\"\",\"\"hoverEvent\":{{{{\"action\":\"show_text\"\",\"\"contents\":[{{{{\"text\":\"{{{generated_achievements[index]}[\"name\"]}}\"\",\"\"strikethrough\":true}}}}]}}}}\",\"\"clickEvent\":{{{{\"action\":\"change_page\"\",\"\"value\":\"{index+2}\"}}}}}}'],CustomName:'{{\"text\":\"row{row}col{col}\"}}'}}\n")
